import logo from './logo.svg';
import SideMenu from './component/SideMenu';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import './App.css';
import MapConmponent from './component/MapComponent';
import React, { createContext, useContext, useState } from 'react';

const SideMenuContext = createContext();

function App() {
  const position = [51.505, -0.09];
  const [selectedItem, setSelectedItem] = useState(null);

  return (
    <div className="App">
      <div className="app-container">
        <div className="map-container">
          {/* <MapContainer center={position} zoom={3} scrollWheelZoom={false}>
            <TileLayer 
              attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
              url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png">
            </TileLayer>
          </MapContainer> */}
          <SideMenuContext.Provider value={{ selectedItem, setSelectedItem }}>
            <MapConmponent/>
          </SideMenuContext.Provider>
        </div>
        <div className="nav-container">
          <SideMenu/>
        </div>
      </div>
    </div>
  );
}
export function SideMenuProvider({ children }) {
  const [selectedItem, setSelectedItem] = useState(null);
  return (
      <SideMenuContext.Provider value={[selectedItem, setSelectedItem]}>
          {children}
      </SideMenuContext.Provider>
  );
}


export function useSideMenu() {
  return useContext(SideMenuContext)
}

export default App;
